INSERT INTO `critic_review` VALUES (163254657939,'EntertainmentWeekly',5,'\"A GoodReads Choice Awards Finalist for Best Romance. \"\"In a class by itself.\"\"\"\r'),(166547301960,'Ted Fry',5,'The loving detail that goes into blowing up the Kremlin or rendering a photo-realistic sandstorm erupting across the enhanced skyline of an Oz-like desert city is nothing short of miraculous. What\'s more astonishing is that Tom Cruise closes the deal with a selling power that\'s as new and improved as the laminates on his multi-million-dollar teeth.\r'),(210982815183,'Brad Burn',4,'\"2012 album from the Grammy-winning Pop/Rock band the follow-up to the band\'s multi-platinum 2009 release Save Me San Francisco. Train recorded the album in San Francisco and Los Angeles with Butch Walker and Espionage producing the record. Train made its mark on music history with their Grammy-winning song \"\"Drops of Jupiter (Tell Me)\"\" and chart-topping singles \"\"Meet Virginia\"\" and \"\"Calling All Angels.\"\" Train earned their third Grammy in 2011 for the worldwide smash \"\"Hey Soul Sister\"\".\"\r'),(218847445114,'Bridgette Sommer',4,'Ultimate Vampire Warrioress Selene (Kate Beckinsale) escapes imprisonment to find herself in a world where humans have discovered the existence of both Vampire and Lycan clans and are conducting an all-out war to eradicate both immortal species.\r'),(283734124008,'Robert Horton',3,'If most of the movie is enjoyable the final 15 minutes or so reveals a curious weakness in the overall design: because Captain America needs to pop up in The Avengers the resolution of the 1943 story line must include a bridge to the 21st century which makes for some tortured (and unsatisfying) plot developments. Nevertheless: that shield is really cool.'),(289506573435,'Steven Richardson',5,'\"Jones drew the inspiration for the album cover from the vintage movie posters that adorn Burton\'s Los Angeles studio. \"\"Brian has this great collection of Russ Meyer posters in his studio\"\" explains Jones \"\"and this particular one called Mudhoney was right over the couch where I sat every day. I always was looking at it and thinking `that\'s so cool I want to look like her!\' I remember staring at the poster the whole time we made the record. It\'s a great visual.\"\"\"\r'),(394010878732,'Eliot Singleton',4,'\"Said long-time manager Jon Landau\"\"Bruce has dug down as deep as he can to come up with this vision of modern life. The lyrics tell a story you can\'t hear anywhere else and the music is his most innovative of recent years. The writing is some of the best of his career and both veteran fans and those who are new to Bruce will find much to love on \'Wrecking Ball.\"\r'),(422233391746,'John Dugdale',4,'There is much to admire here from the flinty depiction of the father-son relationship to the vivid sporting action\'\r'),(447034814530,'John Greene',5,'\"Surpassing his creative and personal boundaries Richie comes full circle with the innovative and personal Tuskegee performing 13 of his most revered \"\"anthems of our day\"\" with some of the biggest names in country music including Sugarland\'s Jennifer Nettles Tim McGraw Blake Shelton Darius Rucker Rascal Flatts Kenny Chesney Billy Currington Little Big Town and Jason Aldean.\"\r'),(481535761625,'Bret Fetzer',5,'The performances of the SEALs though well intentioned make you appreciate the complexities of Arnold Schwarzenegger. What\'s smart about Act of Valor is that it doesn\'t waste much time with setups or dialogue but heads straight into the missions. However much of these missions are filmed like a first-person-shooter video game which lends a sense of immediacy but undercuts the sense of reality. Still all in all Act of Valor is a sincere attempt to express admiration for the men and women risking their lives in the military.\r'),(483996336442,'Chris Schluep',4,'It is difficult to read the opening pages of Walter Isaacson’s Steve Jobs without feeling melancholic.\r'),(555080177372,'Jeff Shannon',5,'As many critics agreed Serenity offered all the fun and breezy excitement that was missing from George Lucas\'s latter-day Star Wars epics and Whedon leaves an opening for a continuing franchise that never feels cheap or commercially opportunistic. With the mega-corporate mysteries of Blue Sun yet to be explored it\'s a safe bet we haven\'t seen the last of the good ship Serenity.\r'),(567023190517,'Tami Horiuchi',5,'Mara\'s performance is chillingly real and completely riveting. Yorick van Wageningen is perfectly despicable as Nils Bjurman (though his scene with Salander is sure to prove highly disturbing to some viewers) Christopher Plummer is an effective Henrik Vanger and Stellen Skarsgård is eerily frightening as Martin Vanger. Viewers can only hope that director David Fincher screenplay writer Steven Zaillian and actors Craig and Mara will continue their collaboration to produce films based on the final two books of Larsson\'s Millennium trilogy.\r'),(705447569208,'Ted Fry',2,'Even though the multitude of beings names and alliances may sometimes elicit a glassy-eyed response there\'s plenty of attention-grabbing exactitude to behold in John Carter. There\'s also a good chance that the fans will make it worth Disney\'s while to shell out another hundred million to keep the saga going.\r'),(766855796404,'EntertainmentWeekly',5,'\"\"\"Fans will be happy to hear that Mockingjay is every bit as complex and imaginative as Hunger Games and Catching Fire.\"\"\"\r'),(807261364628,'Bret Fetzer',5,'The greatest weakness is that director Steven Spielberg doesn\'t connect us to Joey himself; though it\'s impossible not to have moments of empathy with the trials of this beautiful animal at other times the horse is no more than a narrative device carrying us from one micro-story to another. Still some episodes are unquestionably compelling (a sequence in which a British and a German soldier collaborate to rescue Joey is particularly good) and though stylistically all over the place War Horse is never less than visually stunning.\r'),(903942870692,'Paul Gaita',4,'Viewers can tune in to simply enjoy the more visceral elements of Game of Thrones which features quite a bit of medieval-style carnage as well as an at-times unnecessary level of nudity which feels like a network decision based on the amount of flesh on display in their other successful shows. Regardless Game of Thrones is an entirely addictive experience for both fantasy and drama fans alike throughout its debut 10 episodes all of which are featured on this multi-disc set.\r'),(923760740002,'EntertainmentWeekly',4,' Holmes\' investigation into Moriarty\'s plot becomes more dangerous as it leads him and Watson out of London to France Germany and finally Switzerland. But the cunning Moriarty is always one step ahead and moving perilously close to completing his ominous plan. If he succeeds it will not only bring him immense wealth and power but alter the course of history.\r'),(936253283840,'Jordan Brow',4,'\"Hailed as one of the modern era s most gifted pop troubadours Jason Mraz has shared stages with percussionist Noel \"\"Toca\"\" Rivera for more than a decade. The two musicians first met back in 2000 when Mraz was just making his mark on the San Diego coffee house scene.\"\r'),(973417031300,'Associated Press',5,'\"\"\"A complex puzzle . . . Baldacci is a master craftsman.\"\"\"\r');
/*!40000 ALTER TABLE `critic_review` ENABLE KEYS */;
UNLOCK TABLES;

