-- Table structure for table `video_game`
--

DROP TABLE IF EXISTS `video_game`;
/*!40101 SET @saved_cs_client     = @@character_set_client */;
/*!40101 SET character_set_client = utf8 */;
CREATE TABLE `video_game` (
  `Upc` decimal(12,0) NOT NULL,
  `GameTitle` varchar(100) NOT NULL,
  `Publisher` varchar(50) NOT NULL,
  `Console` enum('PC','Xbox360','Playstation3','NintendoWii','Nintendo3DS','Playstation2','NintendoDS','SonyPSP') NOT NULL,
  `EsrbRating` enum('Mature','Everyone','Teen','AO','RP','K-A') DEFAULT NULL,
  `Language` enum('English','French','German','Italian','Portuguese','Russian','Spanish') NOT NULL,
  `Msrp` decimal(6,2) unsigned NOT NULL,
  `ListPrice` decimal(6,2) unsigned NOT NULL,
  `GameRegionCode` varchar(5) NOT NULL,
  PRIMARY KEY (`Upc`),
  KEY `VideoGameFK` (`Upc`),
  CONSTRAINT `VideoGameFK` FOREIGN KEY (`Upc`) REFERENCES `product` (`Upc`) ON DELETE CASCADE ON UPDATE CASCADE
) ENGINE=InnoDB DEFAULT CHARSET=latin1;
/*!40101 SET character_set_client = @saved_cs_client */;

